window.bookSummaryJSON = "<p><b>A </b><b><i>Wall Street Journal</i></b><b> bestseller.</b></p> <p><b>The fifth book in the million-copy bestselling Kingfountain series from Jeff Wheeler.</b></p> <p>Courtly intrigue and rumors of invasion plunge Kingfountain into turmoil as the search for Trynne’s father begins in earnest. But Trynne’s quest to learn the truth of Owen’s sinister disappearance is sidetracked when tragedy strikes her family once again. Suddenly, the future of the kingdom rests in her hands as she struggles to learn - and control - the power that can keep the threatening Deep Fathoms at bay.</p> <p>When King Gahalatine unleashes his overwhelming forces against the realm, Trynne must draw on her political instincts, warrior training, and Fountain-blessed magic if she hopes to survive the chaos to come. But a final, epic confrontation will force Trynne into an unimaginable choice: save her kingdom and the lives of her people, or lose the one who means more to her than life itself.</p>"; 
